import { hover } from '@testing-library/user-event/dist/hover';
import React from 'react';

function Project({ project }) {

  const { title, description, imageUrl, projectUrl } = project;
  
  return (
    <div style={{ marginLeft: "10px", color: '#000000', marginBottom: '25px' }}>
      <img src={imageUrl} alt={title} />
      <h3>{title}</h3>
      <p>{description}</p>
      <a href={projectUrl} target="_blank" rel="noopener noreferrer" style={{ color: '#ffffff', fontSize: '14px', textDecoration: 'none', padding: "8px", borderRadius: "5px", backgroundColor: "#27ae60", border: "none" }}>View Project</a>
    </div>
  );
}

export default Project;
